INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Conçue pour les débutants, la guitare Bird STC1 permet de s'initier à la guitare électrique dans des conditions optimales. Un corps en frêne pour un instrument léger et confortable qui convient à tous les âges, trois micros simples pour un maximum de polyvalence, disponible en plusieurs coloris pour s'adapter au goût de chacun, une construction et des finitions soignées pour une guitare qui tiendra dans le temps, la STC1 ne demande qu'à être jouée.","STC1 RED","images/BIRD_STC1_RED.JPG",79,"REF.005",6,1);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("La gamme Bird acoustique et électro-acoustique a été spécialement pensée pour les guitaristes débutants. Sa configuration traditionnelle, table épicéa et corps acajou, confère aux guitares DG1 une belle sonorité, bien équilibrée, entre brillance et puissance. La très belle finition noire de la DG1 BK et son confort de jeu en font une guitare d apprentissage très réussie.","DG1 NOIRE","images/BIRD_DG1_BK.JPG",69,"REF.006",6,3);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Le ukulélé est l instrument idéal pour s initier à la musique en samusant. La gamme Bird UK1S se décline en plusieurs couleurs pour faire plaisir et se faire plaisir à petit prix.","UK1S NL SOPRANO","images/BIRD_UK1S_NT.JPG",19,"REF.007",6,7);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Blackjack SLS SLS pour Slim Line Series. En effet, le profil de manche est plus plat que traditionnellement chez Schecter. Et qui dit fin dit rapide et idéal pour le jeu soliste. D'autant plus que le dos du manche est satiné pour une vitesse de déplacement optimale. Le corps (aminci pour l'occasion) et le manche sont en acajou et la touche est en ébène. Pour plus de confort, la finition du manche est satinée. Autre particularité, la série est disponible en deux configurations de micros : Active avec les classiques Seymour Duncan Blackouts AHB-1 Passive montée en Seymour Duncan Full Shred SH-10 / JAZZ SH-2N Enfin, sachez que les C1 et C1FR (avec Floyd) sont disponibles avec l'option Sustainiac. Aussi, les modèles 7 et 8 cordes possèdent un diapason plus long pour assurer plus de punch dans les graves! Manche collé, acajou. Touche : palissandre Type de frettes : X-Jumbo Nombre de frettes : 24 Diapason (mm) : 673 Repères : Croix Gothiques Caisse : acajou, finition : Black (BLK) Accessoires: Marque des mécaniques : Grover Type de mécaniques : à blocage Type de chevalet : Fixe, cordes traversantes Marque du chevalet : Tonepros Électronique: Marque des micros : EMG Type de micro : Actif Modèles des micros : EMG 808 (x2) Sélecteur : 3 positions Contrôles : Volume (x2) Tone (x1) Options Disponible en gaucher : Non ","BLACKJACK SLS C 8EX ACTIVE SATIN BLACK","images/SCHECTER_S_BLASLSC8EXA-SBK.JPG",1319,"REF.009",7,1);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Manche Type : Manche collé Bois : Acajou Finition : Laquée Touche Bois : Palissandre Type de frettes : X-Jumbo Nombre de frettes : 24 Diapason (mm) : 673 Repères : Gothic Cross Caisse Bois : Acajou Table : Erable Finition : Black Cherry (BCH) Accessoires Marque des mécaniques : Grover Type de mécaniques : Noir chromé Type de chevalet : Fixe, cordes traversantes Marque du chevalet : Tonepros Électronique Type de micro : Actifs trois bobines (2 micros en 1) Modèles des micros : EMG 808 (x2) Sélecteur : 3 positions Électronique Contrôles : Volume (x2) Tone (x1) Options Disponible en gaucher : Oui, sur commande uniquement.","HELLRAISER C 8 BLACK CHERRY","images/SCHECTER_S_C-8HR-BCH.JPG",1302,"REF.010",7,1);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Manche collé, acajou. Touche : palissandre Type de frettes : X-Jumbo Nombre de frettes : 24 Diapason (mm) : 673 Repères : Croix Gothiques Caisse : acajou, finition : Black (BLK) Accessoires: Marque des mécaniques : Grover Type de mécaniques : à blocage Type de chevalet : Fixe, cordes traversantes Marque du chevalet : Tonepros Électronique:Marque des micros : EMG Type de micro : Actif Modèles des micros : EMG 808 (x2) Sélecteur : 3 positions Contrôles : Volume (x2) Tone (x1) Options Disponible en gaucher : Non ","HELLRAISER C 8 BLACK","images/SCHECTER_S_C-8HR-BLK.JPG",1302,"REF.011",7,1);
