INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("LAT4081 bénéficie de cette nouvelle technologie qui lui permet de restituer dans les moindres détails un son chaud et naturel avec une parfaite précision afin de répondre aux exigences les plus pointues des professionnels de lenregistrement, de la radiodiffusion et de la sonorisation.","AT4081","images/AT+4081+AUDIO+TECHNICA+MICRO+STUDIO.JPG",629,"REF.052",16,9);
