INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("La gamme de cordes Eagletone pour guitare classique est fabriquée selon les techniques de filage traditionnelles pour obtenir des cordes régulières et consistantes. Ce jeu s'adresse tout particulièrement aux guitaristes débutants.","CS N - TENSION NORMALE","images/EAGLETONE+CS+N.JPG",3,"REF.055",8,10);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("La gamme de cordes Eagletone pour guitare classique est fabriquée selon les techniques de filage traditionnelles pour obtenir des cordes régulières et consistantes. Ce jeu offre un son riche et une projection équilibrée, ainsi qu'une bonne stabilité d'accordage grâce à la qualité des matériaux utilisés pour sa fabrication.","CSHQ H - TENSION FORTE","images/EAGLETONE+CSHQ+H.JPG",7,"REF.056",8,10);
