INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Accessoire indispensable du guitariste, les médiators Eagletone sont disponibles en celluloid ou nylon de différents calibres et coloris. Bien finis, les extrémités polies permettent des attaques définies. Ils sont livrés par 12 ou 24 pièces panachées pour tester et trouver le médiator qui vous convient.","CELPICK 12","images/EAGLETONE+CELPICK12.JPG",4,"REF.060",8,11);
