INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Voici le FT1000, grâce à lui, vous bénéficiez d'un confort d'utilisation optimal, finie la traduction simultanée, le FT1000 affiche instantanément la note selon la notation française. Que vous soyez musicien amateur, professionnel ou pour l'apprentissage de vos élèves, le FT1000 s'impose comme le nouveau standard.","FT1000 - ACCORDEUR METRONOME","images/EAGLETONE+FT1000.JPG",20,"REF.064",8,12);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Le MT1000 est l'accordeur-métronome le plus complet jamais proposé à ce jour dans la gamme Eagletone. Il regroupe 3 outils indispensables à la pratique instrumentale (accordeur, métronome et diapason), dont la qualité répond au plus exigeant des utilisateurs. ","MT1000 - ACCORDEUR METRONOME","images/EAGLETONE+MT1000.JPG",15,"REF.065",8,12);
INSERT INTO  `bdd_airbrass_test`.`produit` (`description`,`intitule`,`photo`,`prix`,`reference`,`marque_id`,`specialisationProduit_id`) VALUES ("Compact et facile à utiliser, le FCT-12 fonctionne sur les scènes les plus sombres grâce à son écran à forte luminosité. Son capteur de vibrations performant apporte une réponse rapide et précise, sans être perturbé par les bruits ambiants. L'écran pivote à 360° pour une visualisation idéale quelle que soit sa position. ","FCT-12 ACCORDEUR CHROMATIQUE","images/FMIC+0239978100.JPG",12,"REF.066",2,12);
